import { BrowserRouter, Route, Routes } from "react-router-dom";
import App from "./components/App";
import HomePage from "./pages/HomePage";

function Main() {
  return (
    <BrowserRouter>
      <App>
        <Routes>
          <HomePage />
        </Routes>
      </App>
    </BrowserRouter>
  );
}

export default Main;
